import React, { Component } from 'react'

export class Object extends Component {
  render() {
    return (
      <div className='object'>
            <img src={"111"}></img>
            <h2>{this.props.object.title}</h2>
            <p>{this.props.object.price}</p>       
      </div>
    )
  }
}

export default Object
